import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Register from "./pages/Register";
import Login from "./pages/Login";
import Profile from "./pages/Profile";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="container mt-4">
        <h1 className="text-center text-primary mb-4">Healthcare System</h1>
        <Routes>
          <Route path="/register" element={<Register className="card p-4 shadow-sm" />} />
          <Route path="/login" element={<Login className="card p-4 shadow-sm" />} />
          <Route path="/profile" element={<Profile className="card p-4 shadow-sm" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
